import React from 'react';
import styled from 'styled-components';

import Amazone from '../../img/amazon.svg';
import Booking from '../../img/booking_com.svg';
import Docu from '../../img/docusign.svg';
import Insta from '../../img/instacart.svg';
import Peleton from '../../img/peleton.svg';
import Shopify from '../../img/shopify.svg';
import Unicefy from '../../img/unicef.svg';

const HeaderContainer = styled.div`
    width: 1903px;
    margin-bottom: 170px;
    padding: 200px 0 70px 0;
    position: absolute;

`
const InContainer = styled.div`
    width: 1040px;
    margin: 0 432px;
    padding: 0 20px;
    display: flex;
`
const Image = styled.div`
        width: 262px;
        height: 466px;
        z-index: 5;
    img{

        width: auto;
        height: 48px;
        z-index: 5;
        border-radius: 8px;

    }
`

class LogoBlock extends React.Component {
  render(){
    return (
        <HeaderContainer>
            <InContainer>
                <Image><img src={Amazone} alt="phone"/></Image>
                <Image><img src={Booking} alt="tablet"/></Image>
                <Image><img src={Docu} alt="tablet"/></Image>
                <Image><img src={Insta} alt="tablet"/></Image>
                <Image><img src={Peleton} alt="tablet"/></Image>
                <Image><img src={Shopify} alt="tablet"/></Image>
                <Image><img src={Unicefy} alt="tablet"/></Image>
            </InContainer>


        </HeaderContainer>
    );
  }
}
export default LogoBlock;
